import React from "react"
import './Recipes.css'

function Recipes(){

    return(
        <>
        <div className="recipes-main">
            <a href="/recipes/sweet" className="recipes-inner annuals">Sweet</a>
            <a href="/recipes/savory" className="recipes-inner perennials">Savory</a>
            <a href="/recipes/teatime" className="recipes-inner fruits">Tea Time</a>
            <a href="/recipes/bath-and-body" className="recipes-inner veggies">Bath and Body</a>
            <a href="/recipes/lavender" className="recipes-inner veggies">Lavender</a>
        </div>
        </>
    );
}

export default Recipes;
